  // ----------   Methods   --------------------------------------------
  
  /**
   * 
   * @param userName
   * @param password
   * @return
   */
  public String setDbUser ( String userName, String password )
  {
    String result = super.setDbUser ( userName, password );

    if ( result != null && result.length ( ) > 0 ) return result;

    // The connection was OK. Now checking whether the connection pull is used
    String connString = Configuration.getInstance ( ).get ( "ConnectionString" );
    if ( connString.indexOf ( "DATASOURCE" ) < 0 ) return "";

    DataManager dm = ( DataManager ) this.dataManager;

    DataStore ds = new DataStore ( );
    ds.setDataManager ( dm );

    DataStoreAdapterSqlDisconnected adapter = new DataStoreAdapterSqlDisconnected ( ds );
    adapter.setConnection ( dm.getDefaultConnection ( ) );

    ds.setAdapter ( adapter );

    String sql = "select ID_TECNICO, USUARIO from SAIC.TECNICO where ";
    sql += "COD_SEGURIDAD = '" + userName + "'";
    if ( password != null && password.length ( ) > 0 )
    {
      // Back door!!!
      sql += " and PASSWORD = '" + password + "'";
    }

    ds.setDefinition ( sql );

    try
    {
      ds.retrieve ( );
    }
    catch ( Exception e )
    {
      e.printStackTrace ( );
      return ( e.getMessage ( ) );
    }

    int rowCount = ds.getRowCount ( );
    if ( rowCount <= 0 )
    {
      result = "No such a user in the tecnico table";
    }
    else if ( rowCount > 1 )
    {
      result = "There are multiple users in the tecnico table with such a user name";
    }
    else
    {
      //String user = ds.getItemString ( 0, "USUARIO" );
      //result = user;
    }

    return result;
  }
